const int VIEW_MAIN_PALETTE[] = {16569810,16363434,16291727,15947595,15876918,15452596,13493680,11786118,10669931,9159494,16711422,16641259,16223879,16155257,16083551,15590096};

#define VIEW_MAIN_DOMINANT_COLOR 4

void
drawView_main() {

    int i = 0;
    int palette_size = sizeof(VIEW_MAIN_PALETTE) / sizeof(int);
    for (i = 0; i < palette_size; i++){
        ProgramPalette(i, VIEW_MAIN_PALETTE[i]);
    }

    /* 
     * Paint view w/ dominant color using hardware accelerated function to save time
     * - This allows us to call "WriteAPixel()" lesser amount of time.
     * - "WriteAPixel()" is a really slow function.
     */
    Rectangle(VIEW_POSITION_X, 
                VIEW_POSITION_Y, 
                VIEW_POSITION_X + VIEW_WIDTH, 
                VIEW_POSITION_Y + VIEW_HEIGHT, 
                VIEW_MAIN_DOMINANT_COLOR);

    int j = 0;
    for (j = 0; j < (VIEW_WIDTH * VIEW_HEIGHT); j++) {
        if (VIEW_MAIN_PIXELARRAY[j] == (char) VIEW_MAIN_DOMINANT_COLOR)
            continue;
        else
            WriteAPixel(VIEW_POSITION_X + (j % VIEW_WIDTH), VIEW_POSITION_Y + (j / VIEW_WIDTH), (int) VIEW_MAIN_PIXELARRAY[j]);
    }
}
